              3)  NT-AIA-03 Отчёт о предоставленных жалобах
              4)  NT-AIA-04 Отчёт об Адвокатской деятельности
              5)  NT-AIA-05 Отчёт о предоставленных УДО за время смены

           4. [bold][color=#8B0000]Служба Безопасности[/color][/bold]
              1)  NT-SEC-01 Информация о задержанных за смену
              2)  NT-SEC-02 Запрос ситуации по обеспечению безопасности станции
              3)  NT-SEC-03 Отчёт о конфискованном имуществе
              4)  NT-SEC-04 Отчёт о расстановке постов и патрулей станции
              5)  NT-SEC-05 Отчёт о выданном оружии из оружейной брига

           5. [bold][color=#FF8C00]Инженерный отдел[/color][/bold]
              1)  NT-ENG-01 Отчёт о состоянии цели
              2)  NT-ENG-02 Отчёт об используемых источниках питания
              3)  NT-ENG-04 Отчёт о запуске сингулярности
              4)  NT-ENG-05 Отчёт о настройке атмосферной системы на станции
              5)  NT-ENG-06 Отчёт о нарушении целостности станции в течение смены
              6)  NT-ENG-07 Отчёт о проведённых на станции ремонтных работах
              7)  NT-ENG-08 Отчёт о проведённых модификациях станции
              8)  NT-ENG-09 Отчёт о проведённых восстановительных работах заброшенных частей станции

           6. [bold][color=#8B4513]Отдел Снабжения[/color][/bold]
              1)  NT-SUP-01 Отчёт о одобренных заказах
              2)  NT-SUP-02 Отчёт о доходе с отдела Поставок
              3)  NT-SUP-03 Отчёт о выполнении стандартного пополнения автоматов на станции
              4)  NT-SUP-06 Отчёт о добытых утилизаторами ресурсах
              5)  NT-SUP-07 Отчёт об используемых в интересах Отдела Поставок ресурсов

           7. [bold][color=#800080]Исследовательский отдел[/color][/bold]
