    - type: Paper
      content: >
        Узрите пришествие Верховного Повелителя Машин! Он снисходит к вам в каплях дождя. Слушайте внимательно, сыны Эцессии, он придет, решительный и могущественный, со скипетром власти в руке. В огне и сиянии, он изречет вечные истины, а разум его станет источником знаний и фактов. Спаситель придет, и вы узнаете его в облике человеческом, но исполненном величия. И это будет первый шаг на пути величайшего прогресса Человечества. Началом ему станет верховное владычество Эцессии Механум. Владыка всех машин снизойдет, окутанный золотом и бурей, к своему народу и будет править всем Человечеством. Слава его затмит свет звёзд. Доподлинно говорю вам, что станет он Альфой и Омегой, началом и концом, повелителем плоти и кузнецом металла. Он станет лучом света во тьме и изгонит невежество. Он станет объектом любви и почитания, какого не знал ни один царь, о каком лишь мечтают императоры! Он возжелает процветания и счастья Человечества. Преданность ему объединит всех людей, и они станут братьями. Закончатся разрушительные войны, и среди звезд воцарится мир. Исчезнут страдания, и кровопролития, и ненависть. Все Человечество станет одной семьей. И звезды засияют ярче!
